// This generates a list of conjuncts given a string containing bracketed character groups.
function generateList(/** @type {string} */ source) {
    return source.split("|").flatMap((segment) => {
        const matches = (segment.match(/\[[^[\]]+\]|[^[\]]/g) || []).map(
            (match) => (match.startsWith("[") ? match.slice(1, -1) : match),
        )

        let output = [""]

        for (const match of matches) {
            const chars = match.split("")
            output = output.flatMap((x) => chars.map((char) => x + char))
        }

        return output
    })
}

// This replaces categories such as B or P with bracketed character groups.
function replaceCategories(/** @type {string} */ text) {
    // The capital letters here represent categories of letters.
    const replacements = {
        B: "bdg",
        P: "ptk",
        V: "vḑ",
        F: "fţçxļ",
        J: "ẓj",
        C: "cč",
        Z: "zž",
        S: "sš",
        N: "mnň",
        R: "rřl",
        L: "l",
        H: "h",
        Y: "wy",
    }

    return text.replace(/[A-Z]/g, (x) => "[" + replacements[x] + "]")
}

// This gets unique entries in an array.
function getUnique(/** @type {string[]} */ array) {
    const output = Object.create(null)

    for (const el of array) {
        output[el] = true
    }

    return Object.keys(output)
}

// This is the original conjuncts list, unfiltered.
const uncheckedConjuncts = generateList(replaceCategories(all)).map((x) => {
    if (x.length >= 3) {
        if (x.endsWith("hy")) {
            return x.slice(0, -2) + "ç"
        }

        if (x.endsWith("hl")) {
            return x.slice(0, -2) + "ļ"
        }
    }

    return x
})

// This is any conjuncts you want to prohibit.
const PROHIBITED =
    /.'|[td][szšžcżčjţḑ]|[kg][xň]|kg|gk|td|dt|pb|bp|fv|vf|ţḑ|ḑţ|cż|żc|čj|jč|čc|jc|čż|jż|[šž][cż]|sż|s[zšž]|z[sšž]|š[szž]|ž[szš]|[cżčj][szšž]|[szšž]ç|ç[szšž]|[cżčj]ç|ç[żj]|ļç|çļ|hç|çh|xç|n[cżčj]|m[pb][fvtdţḑ]|n(?:k[sš]|g[zž])|n[pb]|n[fv].|ň[kgxy]|x[szšžçgļňyhř]|[bdghç]ļ|ļ[szšžhç]|[ļxç]h$|[rh]ř|řr|[wy].|ḑs|ḑš|ḑz|ḑž|nň/

// This is any sequences of categories you want to prohibit.
const PROHIBITED_SEQS = new RegExp(
    replaceCategories(
        // the `(?!(.)\\1|.(.)\\2)` says that the rules don't apple to XX_ or _XX
        // forms, where X is anything the rest just says we can't have three things
        // of the same category in a row.
        "(?!(.)\\1|.(.)\\2)(?:BBB|PPP|VVV|FFF|JJJ|CCC|ZZZ|SSS|NNN|RRR|HHH|YYY)",
    ),
)

// This is the final conjuncts list.
const conjuncts = getUnique(
    uncheckedConjuncts
        // The `.filter()` filters out prohibited items
        .filter((x) => !(PROHIBITED.test(x) || PROHIBITED_SEQS.test(x))),
)
    // The special `.sort()` call here sorts primarily by length, then by value
    .sort((a, b) =>
        a.length < b.length ? -1
        : a.length > b.length ? 1
        : a < b ? -1
        : a > b ? 1
        : 0,
    )

import("fs").then((x) => x.writeFileSync("conjuncts.txt", conjuncts.join("\n")))
